import React from 'react';
import '../stylesheets/Components.css'
import Advertisement from './Advertisement';
import test from '../images/fonar.png';


function AdvertisementBlock() {
  return (
	<Advertisement
		nameBlockA='test'
		infoBlockA='test 2'
		imageBlockA={test}
	/>
  )
}

export default AdvertisementBlock
